describe("google adapter streaming", () => {
  it("parses newline-delimited stream-json chunks during execution", async () => {
    runCommandMock.mockImplementationOnce(async ({ onStdout }: { onStdout?: (chunk: string) => void }) => {
      onStdout?.('{"type":"message","role":"assistant","content":"first","delta":true}\n');
