  console.log("Starting real provider call to inspect thinking stream...");

  const result = await googleAdapter.execute({
    model: "gemini-3.1-pro-preview", // Using the SOTA model from catalog
    thinkingValue: "high",
    prompt: "Write a short poem about a mechanical butterfly. Then explain the symbolism in 3 sentences.",
    cwd: process.cwd(),
    timeoutMs: 60000,
    attempt: 1,
    sessionStrategy: "reset",
    streamingEnabled: true,
    onEvent: (event) => {
