    userInput: types.Content,
    modelOutput: types.Content[],
    automaticFunctionCallingHistory?: types.Content[],
  ) {
    let outputContents: types.Content[] = [];
    if (
      modelOutput.length > 0 &&
      modelOutput.every((content) => content.role !== undefined)
