rue if the object is a MCP CallableTool, otherwise false.\nfunction isMcpCallableTool(object: unknown): boolean {\n  return (\n    object !== null &&\n    typeof object === 'object' &&\n    object instanceof McpCallableTool\n  );\n}\n\n// List all tools from the MCP client.\nasync function* listAllTools(\n  mcpClient: McpClient,\n  maxTools: number = 100,\n): AsyncGenerator<McpTool> {\n  let cursor: string | undefined = undefined;\n  let numTools = 0;\n  while (numTools < maxTools) {\n    const t = await mcpClient.listTools({cursor});\n    for (const tool of t.tools) {\n      yield tool;\n      numTools++;\n    }\n    if (!t.nextCursor) {\n      break;\n    }\n    cursor = t.nextCursor;\n  }\n}\n\n/**\n * McpCallableTool can be used for model inference and invoking MCP clients with\n * given function call arguments.\n *\n * @experimental Built-in MCP support is an experimental feature, may change in future\n * versions.\n */\nexport class McpCallableTool implements CallableTool {\n  private readonly mcpClients;\n  private mcpTools: McpTool[] = [];\n  private functionNameToMcpClient: Record<string, McpClient> = {};\n  private readonly config: CallableToolConfig;\n\n  private constructor(\n    mcpClients: McpClient[] = [],\n    config: CallableToolConfig,\n  ) {\n    this.mcpClients = mcpClients;\n    this.config = config;\n  }\n\n  /**\n   * Creates a McpCallableTool.\n   */\n  public static create(\n    mcpClients: McpClient[],\n    config: CallableToolConfig,\n  ): McpCallableTool {\n    return new McpCallableTool(mcpClients, config);\n  }\n\n  /**\n   * Validates the function names are not duplicate and initialize the function\n   * name to MCP client mapping.\n   *\n   * @throws {Error} if the MCP tools from the MCP clients have duplicate tool\n   *     names.\n   */\n  async initialize() {\n    if (this.mcpTools.length > 0) {\n      return;\n    }\n\n    const functionMap: Record<string, McpClient> = {};\n    const mcpTools: McpTool[] = [];\n    for (const mcpClient of this.mcpClients) {\n      for await (const mcpTool of listAllTools(mcpClient)) {\n        mcpTools.push(mcpTool);\n        const mcpToolName = mcpTool.name as string;\n        if (functionMap[mcpToolName]) {\n          throw new Error(\n            `Duplicate function name ${\n              mcpToolName\n            } found in MCP tools. Please ensure function names are unique.`,\n          );\n        }\n        functionMap[mcpToolName] = mcpClient;\n      }\n    }\n    this.mcpTools = mcpTools;\n    this.functionNameToMcpClient = functionMap;\n  }\n\n  public async tool(): Promise<Tool> {\n    await this.initialize();\n    return mcpToolsToGeminiTool(this.mcpTools, this.config);\n  }\n\n  public async callTool(functionCalls: FunctionCall[]): Promise<Part[]> {\n    await this.initialize();\n    const functionCallResponseParts: Part[] = [];\n    for (const functionCall of functionCalls) {\n      if (functionCall.name! in this.functionNameToMcpClient) {\n        const mcpClient = this.functionNameToMcpClient[functionCall.name!];\n        let requestOptions = undefined;\n        // TODO: b/424238654 - Add support for finer grained timeout control.\n        if (this.config.timeout) {\n          requestOptions = {\n            timeout: this.config.timeout,\n          };\n        }\n        const callToolResponse = await mcpClient.callTool(\n          {\n            name: functionCall.name!,\n            arguments: functionCall.args,\n          },\n          // Set the result schema to undefined to allow MCP to rely on the\n          // default schema.\n          undefined,\n          requestOptions,\n        );\n        functionCallResponseParts.push({\n          functionResponse: {\n            name: functionCall.name,\n            response: callToolResponse.isError\n              ? {error: callToolResponse}\n              : (callToolResponse as Record<string, unknown>),\n          },\n        });\n      }\n    }\n    return functionCallResponseParts;\n  }\n}\n\nfunction isMcpClient(client: unknown): client is McpClient {\n  return (\n    client !== null &&\n    typeof client === 'object' &&\n    'listTools' in client &&\n    typeof client.listTools === 'function'\n  );\n}\n\n/**\n * Creates a McpCallableTool from MCP clients and an optional config.\n *\n * The callable tool can invoke the MCP clients with given function call\n * arguments. (often for automatic function calling).\n * Use the config to modify tool parameters such as behavior.\n *\n * @experimental Built-in MCP support is an experimental feature, may change in future\n * versions.\n */\nexport function mcpToTool(\n  ...args: [...McpClient[], CallableToolConfig | McpClient]\n): CallableTool {\n  // Set MCP usage for telemetry.\n  hasMcpToolUsageFromMcpToTool = true;\n  if (args.length === 0) {\n    throw new Error('No MCP clients provided');\n  }\n  const maybeConfig = args[args.length - 1];\n  if (isMcpClient(maybeConfig)) {\n    return McpCallableTool.create(args as McpClient[], {});\n  }\n  return McpCallableTool.create(\n    args.slice(0, args.length - 1) as McpClient[],\n    maybeConfig,\n  );\n}\n\n/**\n * Sets the MCP tool usage flag from calling mcpToTool. This is used for\n * telemetry.\n */\nexport function setMcpToolUsageFromMcpToTool(mcpToolUsage: boolean) {\n  hasMcpToolUsageFromMcpToTool = mcpToolUsage;\n}\n","/**\n * @license\n * Copyright 2025 Google LLC\n * SPDX-License-Identifier: Apache-2.0\n */\n\n/**\n * Live music client.\n *\n * @experimental\n */\n\nimport {ApiClient} from './_api_client.js';\nimport {Auth} from './_auth.js';\nimport * as t from './_transformers.js';\nimport {WebSocket, WebSocketCallbacks, WebSocketFactory} from './_websocket.js';\nimport * as converters from './converters/_live_converters.js';\nimport * as types from './types.js';\n\n/**\n * Handles incoming messages from the WebSocket.\n *\n * @remarks\n * This function is responsible for parsing incoming messages, transforming them\n * into LiveMusicServerMessage, and then calling the onmessage callback.\n * Note that the first message which is received from the server is a\n * setupComplete message.\n *\n * @param apiClient The ApiClient instance.\n * @param onmessage The user-provided onmessage callback (if any).\n * @param event The MessageEvent from the WebSocket.\n */\nasync function handleWebSocketMessage(\n  apiClient: ApiClient,\n  onmessage: (msg: types.LiveMusicServerMessage) => void,\n  event: MessageEvent,\n): Promise<void> {\n  const serverMessage: types.LiveMusicServerMessage =\n    new types.LiveMusicServerMessage();\n  let data: types.LiveMusicServerMessage;\n  if (event.data instanceof Blob) {\n    data = JSON.parse(await event.data.text()) as types.LiveMusicServerMessage;\n  } else {\n    data = JSON.parse(event.data) as types.LiveMusicServerMessage;\n  }\n  Object.assign(serverMessage, data);\n  onmessage(serverMessage);\n}\n\n/**\n   LiveMusic class encapsulates the configuration for live music\n   generation via Lyria Live models.\n\n   @experimental\n  */\nexport class LiveMusic {\n  constructor(\n    private readonly apiClient: ApiClient,\n    private readonly auth: Auth,\n    private readonly webSocketFactory: WebSocketFactory,\n  ) {}\n\n  /**\n     Establishes a connection to the specified model and returns a\n     LiveMusicSession object representing that connection.\n\n     @experimental\n\n     @remarks\n\n     @param params - The parameters for establishing a connection to the model.\n     @return A live session.\n\n     @example\n     ```ts\n     let model = 'models/lyria-realtime-exp';\n     const session = await ai.live.music.connect({\n       model: model,\n       callbacks: {\n         onmessage: (e: MessageEvent) => {\n           console.log('Received message from the server: %s\\n', debug(e.data));\n         },\n         onerror: (e: ErrorEvent) => {\n           console.log('Error occurred: %s\\n', debug(e.error));\n         },\n         onclose: (e: CloseEvent) => {\n           console.log('Connection closed.');\n         },\n       },\n     });\n     ```\n    */\n  async connect(\n    params: types.LiveMusicConnectParameters,\n  ): Promise<LiveMusicSession> {\n    if (this.apiClient.isVertexAI()) {\n      throw new Error('Live music is not supported for Vertex AI.');\n    }\n    console.warn(\n      'Live music generation is experimental and may change in future versions.',\n    );\n\n    const websocketBaseUrl = this.apiClient.getWebsocketBaseUrl();\n    const apiVersion = this.apiClient.getApiVersion();\n    const headers = mapToHeaders(this.apiClient.getDefaultHeaders());\n    const apiKey = this.apiClient.getApiKey();\n    const url = `${websocketBaseUrl}/ws/google.ai.generativelanguage.${\n      apiVersion\n    }.GenerativeService.BidiGenerateMusic?key=${apiKey}`;\n\n    let onopenResolve: (value: unknown) => void = () => {};\n    const onopenPromise = new Promise((resolve: (value: unknown) => void) => {\n      onopenResolve = resolve;\n    });\n\n    const callbacks: types.LiveMusicCallbacks = params.callbacks;\n\n    const onopenAwaitedCallback = function () {\n      onopenResolve({});\n    };\n\n    const apiClient = this.apiClient;\n    const websocketCallbacks: WebSocketCallbacks = {\n      onopen: onopenAwaitedCallback,\n      onmessage: (event: MessageEvent) => {\n        void handleWebSocketMessage(apiClient, callbacks.onmessage, event);\n      },\n      onerror:\n        callbacks?.onerror ??\n        function (e: ErrorEvent) {\n          void e;\n        },\n      onclose:\n        callbacks?.onclose ??\n        function (e: CloseEvent) {\n          void e;\n        },\n    };\n\n    const conn = this.webSocketFactory.create(\n      url,\n      headersToMap(headers),\n      websocketCallbacks,\n    );\n    conn.connect();\n    // Wait for the websocket to open before sending requests.\n    await onopenPromise;\n\n    const model = t.tModel(this.apiClient, params.model);\n    const setup = {model};\n    const clientMessage = {setup};\n    conn.send(JSON.stringify(clientMessage));\n\n    return new LiveMusicSession(conn, this.apiClient);\n  }\n}\n\n/**\n   Represents a connection to the API.\n\n   @experimental\n  */\nexport class LiveMusicSession {\n  constructor(\n    readonly conn: WebSocket,\n    private readonly apiClient: ApiClient,\n  ) {}\n\n  /**\n    Sets inputs to steer music generation. Updates the session's current\n    weighted prompts.\n\n    @param params - Contains one property, `weightedPrompts`.\n\n      - `weightedPrompts` to send to the model; weights are normalized to\n        sum to 1.0.\n\n    @experimental\n   */\n  async setWeightedPrompts(\n    params: types.LiveMusicSetWeightedPromptsParameters,\n  ) {\n    if (\n      !params.weightedPrompts ||\n      Object.keys(params.weightedPrompts).length === 0\n    ) {\n      throw new Error(\n        'Weighted prompts must be set and contain at least one entry.',\n      );\n    }\n    const clientContent =\n      converters.liveMusicSetWeightedPromptsParametersToMldev(params);\n    this.conn.send(JSON.stringify({clientContent}));\n  }\n\n  /**\n    Sets a configuration to the model. Updates the session's current\n    music generation config.\n\n    @param params - Contains one property, `musicGenerationConfig`.\n\n      - `musicGenerationConfig` to set in the model. Passing an empty or\n    undefined config to the model will reset the config to defaults.\n\n    @experimental\n   */\n  async setMusicGenerationConfig(params: types.LiveMusicSetConfigParameters) {\n    if (!params.musicGenerationConfig) {\n      params.musicGenerationConfig = {};\n    }\n    const setConfigParameters =\n      converters.liveMusicSetConfigParametersToMldev(params);\n    this.conn.send(JSON.stringify(setConfigParameters));\n  }\n\n  private sendPlaybackControl(playbackControl: types.LiveMusicPlaybackControl) {\n    const clientMessage = {playbackControl};\n    this.conn.send(JSON.stringify(clientMessage));\n  }\n\n  /**\n   * Start the music stream.\n   *\n   * @experimental\n   */\n  play() {\n    this.sendPlaybackControl(types.LiveMusicPlaybackControl.PLAY);\n  }\n\n  /**\n   * Temporarily halt the music stream. Use `play` to resume from the current\n   * position.\n   *\n   * @experimental\n   */\n  pause() {\n    this.sendPlaybackControl(types.LiveMusicPlaybackControl.PAUSE);\n  }\n\n  /**\n   * Stop the music stream and reset the state. Retains the current prompts\n   * and config.\n   *\n   * @experimental\n   */\n  stop() {\n    this.sendPlaybackControl(types.LiveMusicPlaybackControl.STOP);\n  }\n\n  /**\n   * Resets the context of the music generation without stopping it.\n   * Retains the current prompts and config.\n   *\n   * @experimental\n   */\n  resetContext() {\n    this.sendPlaybackControl(types.LiveMusicPlaybackControl.RESET_CONTEXT);\n  }\n\n  /**\n     Terminates the WebSocket connection.\n\n     @experimental\n   */\n  close() {\n    this.conn.close();\n  }\n}\n\n// Converts an headers object to a \"map\" object as expected by the WebSocket\n// constructor. We use this as the Auth interface works with Headers objects\n// while the WebSocket constructor takes a map.\nfunction headersToMap(headers: Headers): Record<string, string> {\n  const headerMap: Record<string, string> = {};\n  headers.forEach((value, key) => {\n    headerMap[key] = value;\n  });\n  return headerMap;\n}\n\n// Converts a \"map\" object to a headers object. We use this as the Auth\n// interface works with Headers objects while the API client default headers\n// returns a map.\nfunction mapToHeaders(map: Record<string, string>): Headers {\n  const headers = new Headers();\n  for (const [key, value] of Object.entries(map)) {\n    headers.append(key, value);\n  }\n  return headers;\n}\n","/**\n * @license\n * Copyright 2025 Google LLC\n * SPDX-License-Identifier: Apache-2.0\n */\n\n/**\n * Live client.\n *\n * @experimental\n */\n\nimport {ApiClient} from './_api_client.js';\nimport {Auth} from './_auth.js';\nimport * as t from './_transformers.js';\nimport {WebSocket, WebSocketCallbacks, WebSocketFactory} from './_websocket.js';\nimport * as converters from './converters/_live_converters.js';\nimport {contentToMldev} from './converters/_models_converters.js';\nimport {hasMcpToolUsage, setMcpUsageHeader} from './mcp/_mcp.js';\nimport {LiveMusic} from './music.js';\nimport * as types from './types.js';\n\nconst FUNCTION_RESPONSE_REQUIRES_ID =\n  'FunctionResponse request must have an `id` field from the response of a ToolCall.FunctionalCalls in Google AI.';\n\n/**\n * Handles incoming messages from the WebSocket.\n *\n * @remarks\n * This function is responsible for parsing incoming messages, transforming them\n * into LiveServerMessages, and then calling the onmessage callback. Note that\n * the first message which is received from the server is a setupComplete\n * message.\n *\n * @param apiClient The ApiClient instance.\n * @param onmessage The user-provided onmessage callback (if any).\n * @param event The MessageEvent from the WebSocket.\n */\nasync function handleWebSocketMessage(\n  apiClient: ApiClient,\n  onmessage: (msg: types.LiveServerMessage) => void,\n  event: MessageEvent,\n): Promise<void> {\n  const serverMessage: types.LiveServerMessage = new types.LiveServerMessage();\n  let jsonData: string;\n  if (event.data instanceof Blob) {\n    jsonData = await event.data.text();\n  } else if (event.data instanceof ArrayBuffer) {\n    jsonData = new TextDecoder().decode(event.data);\n  } else {\n    jsonData = event.data;\n  }\n\n  const data = JSON.parse(jsonData) as types.LiveServerMessage;\n\n  if (apiClient.isVertexAI()) {\n    const resp = converters.liveServerMessageFromVertex(data);\n    Object.assign(serverMessage, resp);\n  } else {\n    const resp = data;\n    Object.assign(serverMessage, resp);\n  }\n\n  onmessage(serverMessage);\n}\n\n/**\n   Live class encapsulates the configuration for live interaction with the\n   Generative Language API. It embeds ApiClient for ge