import { googleAdapter } from "../src/providers/google.js";

async function main() {
  console.log("Starting real provider call to inspect thinking stream...");

  const result = await googleAdapter.execute({
    model: "gemini-3-flash-preview", 
    thinkingValue: "high",
    prompt: "A bat and a ball cost $1.10 in total. The bat costs $1.00 more than the ball. How much does the ball cost? Explain your reasoning step-by-step.",
    cwd: process.cwd(),
    timeoutMs: 60000,
    attempt: 1,
    sessionStrategy: "reset",
    streamingEnabled: true,
    onEvent: (event) => {
      if (event.type === "thinking") {
        console.log("\n[THINKING]", event.payload.summary);
      } else if (event.type === "assistant_text") {
        process.stdout.write(event.payload.text as string);
      } else if (event.type === "status") {
        console.log(`\n[STATUS]`, event.payload.status || event.payload.line);
      } else if (event.type === "error") {
        console.error(`\n[ERROR]`, event.payload.error);
      }
    },
  });

  console.log("\n\n--- Execution Finished ---");
  console.log("OK:", result.ok);
  console.log("Session ID:", result.sessionId);
  if (result.thinkingSummary) {
    console.log("Thinking Summary:", result.thinkingSummary);
  }
}

main().catch(console.error);

