  }

  return {
    text: finalText.trim(),
    sessionId,
    events,
    thinkingSummary: summarizeThinking(events),
  };
}

function mergeUniqueEvents(primary: ProviderOutputEvent[], secondary: ProviderOutputEvent[]): ProviderOutputEvent[] {
